import React,{Component} from 'react';
import {Route,Redirect} from 'react-router-dom';

class AuthUser extends Component {
    constructor(){
        super();
        this.state={
            hasAuth:false,//是否发送过授权请求
            auth:false,  //授权结果
        }

    }
}
export default AuthUser;
